    false,nt"url": null,nt"notes": "This narrative report for Sand Lake NWR
    outlines Refuge accomplishments from February through April of 1941. The report
    begins by summarizing the weather conditions, water conditions, and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, predators, rodents, mammals, raptors, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    plantings. Resource management is outlined; topics include fur harvesting and commercial
    fishing. The public relations section of the report describes Refuge visitors and
    violations. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
